import React from 'react';
// import {Nav, Navbar} from 'react-bootstrap';
import { Nav, Navbar, NavItem } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import ShoppingCartIcon from "@material-ui/icons/ShoppingCart";
import Badge from "@material-ui/core/Badge";
import { Button } from 'react-bootstrap';



const Header = () => (


  <div>

    <Navbar bg="dark" variant="dark">
      <Navbar.Brand href="#home">ShoppingCart</Navbar.Brand>
      <Nav className="me-auto">

      </Nav>

      <Nav>      
        <NavItem href="#">
          <Link to="/cart">
            <a style={{ padding: '20px' }}>View Cart</a></Link>
        </NavItem> 
         <NavItem href="#">
          <Link to="/">Go Home Page</Link>
        </NavItem>
        <NavItem href="#">
          <div>
        <li class="nav-item dropdown">
          <a class="nav-link dropdown-toggle" href="#" role="button" data-bs-toggle="dropdown">Dropdown</a>
          <ul class="dropdown-menu">
            <li><a class="dropdown-item">Link</a></li>
            <li><a class="dropdown-item">Another link</a></li>
            <li><a class="dropdown-item">A third link</a></li>
          </ul>
        </li>
        </div>
        </NavItem>
      </Nav>

    </Navbar>
  </div>
);

export default Header;
